INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (0.5, 100411, "まじめだな～、キョウカは。\nミソギがケーキをもらったときは、\nまずどの飾りから食べようかなーって\n思ってたくらいなのに。", 35314063, 0, 11, 1, 0, 1, 35314, 10);
